## Descrição

Nessa issue esperamos realizar uma filtragem de trechos que tenham o nosso dado a ser explorado. Faremos por meio de Regex.

## Objetivo

Fazer filtragem dos DOU's com Regex em busca de dados para o nosso projeto.

## Pontos Importantes

- [x] Varrer vários DOU's em txt;
- [x] Utilizar Regex na busca;
- [x] Separar trechos em um arquivo de texto;
- [x] Separar dado em um arquivo JSON.

## Critérios de Aceitação

- [x] Utilização do Regex;
- [x] Documentação do código;
- [x] Aprovação dos membros.

## Descrição

Scrapy é um biblioteca Python para coletar dados da web de forma eficiente e escalável. O uso da biblioteca pode ser útil na coleta de dados para o projeto.

## Objetivo

O objetivo deste treinamento é familiarizar os membros da equipe com os principais conceitos e técnicas associados à biblioteca Scrapy.

## Pontos Importantes

- [x] Introdução ao Scrapy: Princípios e benefícios;
- [x] Criação de spiders e definição de regras de extração;
- [x] Utilização de seletores para extrair dados;
- [x] Gerenciamento de requisições e respostas HTTP.
 
## Critérios de Aceitação

- [x] Os participantes devem entender e compreender o conteúdo de forma rápida;
- [x] Os participantes, ao final, devem ser capazes de criar spiders para extração de dados;

## Descrição

O quadro de tarefas Kanban é uma ferramenta visual usada para gerenciar e controlar o fluxo de trabalho em equipes ou projetos. Ele consiste em colunas que representam os estágios do processo, e cartões que representam tarefas ou itens a serem realizados.

## Objetivo

- Melhorar visualização do progresso da equipe;
- Organização do Projeto;

